  \"2016-03-17T20:51:42.423341\",\n\t\"name\": \"state-of-iowa-accountable-government-act-reports-and-plans\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Iowa Department of Management is responsible
  for implementing and administering the state's Performance Management System established
  in 2001 through the Iowa Accountable Government Act. Iowa's performance management
  system provides a framework for actively using performance data to improve state
  government results so we can better serve customers. This framework ensures executive
  branch state agencies have sound performance planning and reporting, strategic planning
  and proven results.   Agency strategic plans identify essential goals, strategies,
  and measures to guide progress in achieving the department's vision and mission
  as well as define how the agency contributes to achievement of the enterprise goals.
  \ Agency performance plans look at the agency's mission (the purpose or why the
  agency exists) and define the operations (core functions and key services, products
  and/or activities) that are in place to achieve that mission.  Agency performance
  reports compare actual performance with projected levels for key areas outlined
  in the agency strategic plan and the agency performance plan.  Agency performance
  plans are due to the Iowa Department of Management on December 15th for the preceding
  fiscal year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
